(29, 'OD1730083359943', 44, 18524, '2024-10-28 10:42:40', '尚未付款', '{\"plane\":{\"id\":30537,\"airline\":\"東方航空\",\"type\":\"MU5008\",\"date_start\":\"2024-10-29\",\"date_end\":\"2024-10-29\",\"des_start\":\"TPE\",\"des_end\":\"PVG\",\"time_start\":\"15:30:00\",\"time_end\":\"17:30:00\",\"bus_price\":16007,\"eco_price\":8907,\"eco_quantity\":200,\"bus_quantity\":12},\"time_zone\":\"0\",\"airport_name\":\"上海浦東國際機場\",\"city\":\"上海\",\"duration\":120,\"des_start\":\"台灣\",\"des_end\":\"上海\",\"seat\":\"經濟艙\",\"adults\":1,\"child\":0}', '{\"plane\":{\"id\":42793,\"airline\":\"長榮航空\",\"type\":\"BR2781\",\"date_start\":\"2024-10-30\",\"date_end\":\"2024-10-30\",\"des_start\":\"PVG\",\"des_end\":\"TPE\",\"time_start\":\"11:15:00\",\"time_end\":\"13:25:00\",\"bus_price\":20367,\"eco_price\":9617,\"eco_quantity\":138,\"bus_quantity\":8},\"time_zone\":\"0\",\"airport_name\":\"臺灣桃園國際機場\",\"city\":\"台北\",\"duration\":130,\"des_start\":\"上海\",\"des_end\":\"台灣\",\"seat\":\"經濟艙\",\"adults\":1,\"child\":0}'),
